import styled from 'styled-components'

type BotaoProps = {
  principal:boolean
}

const Botao = styled.button<BotaoProps>`
  background-color: ${(props) => (props.principal ? 'green' : 'blue')};
  margin: 10px;
`

function Teste() {
  return <Botao>Ola teste</Botao>
}

export default Teste
